    } finally {
      setLoading(false);
    }
  };

  const formatDate = (timestamp: number) => {
    const date = new Date(timestamp);
    const now = new Date();
    const diffMs = now.getTime() - date.getTime();
    const diffMins = Math.floor(diffMs / 60000);
    const diffHours = Math.floor(diffMs / 3600000);
    const diffDays = Math.floor(diffMs / 86400000);

    if (diffMins < 1) return '„Åü„Å£„Åü‰ªä';
    if (diffMins < 60) return `${diffMins}ÂàÜÂâç`;
    if (diffHours < 24) return `${diffHours}ÊôÇÈñìÂâç`;
    if (diffDays < 7) return `${diffDays}Êó•Ââç`;

    return date.toLocaleDateString('ko-KR');
  };

  const handlePostClick = (postId: number) => {
    navigate(`/posts/${postId}`);
  };

  if (loading) {
    return (
      <div className="search-page">
        <div className="loading">Ê§úÁ¥¢‰∏≠...</div>
      </div>
    );
  }

  return (
    <div className="search-page">
      <div className="search-container">
        <div className="search-header">
          <h1>Ê§úÁ¥¢ÁµêÊûú</h1>
          <p className="search-query">"{query}"„ÅÆÊ§úÁ¥¢ÁµêÊûú ({posts.length}‰ª∂)</p>
        </div>

        {error && <div className="error-message">{error}</div>}

        {posts.length === 0 ? (
          <div className="no-results">
            <div className="no-results-icon">üîç</div>
            <h2>Ê§úÁ¥¢ÁµêÊûú„Åå„ÅÇ„Çä„Åæ„Åõ„Çì</h2>
            <p>‰ªñ„ÅÆ„Ç≠„Éº„ÉØ„Éº„Éâ„ÅßÊ§úÁ¥¢„Åó„Å¶„Åè„Å†„Åï„ÅÑ„ÄÇ</p>
          </div>
        ) : (
          <div className="search-results">
            {posts.map((post) => (
              <div
                key={post.id}
                className="post-card"
                onClick={() => handlePostClick(post.id)}
              >
                <div className="post-header">
                  <span className="board-name">{post.boardName}</span>
                  <span className="post-date">{formatDate(post.createdAt)}</span>
                </div>

                <h3 className="post-title">{post.title}</h3>

                <div className="post-preview">
                  {post.content.substring(0, 150)}
                  {post.content.length > 150 && '...'}
                </div>

                <div className="post-meta">
                  <span className="author">{post.author}</span>
                  <span className="separator">‚Ä¢</span>
                  <span className="stat">üëÅÔ∏è {post.viewCount}</span>
                  <span className="separator">‚Ä¢</span>
                  <span className="stat">‚ù§Ô∏è {post.likeCount}</span>
                  <span className="separator">‚Ä¢</span>
                  <span className="stat">üí¨ {post.commentCount}</span>
                </div>
